import './Expenses.css'
import ExpenseItem from './ExpenseItem';

function Expenses(props) {
    let array = []
    for (let i = 0; i < props.num; i += 1) {
        array.push(<div className='expenses'><ExpenseItem date={props.expense[i].date} title={props.expense[i].title} amount={props.expense[i].amount} /></div>);
    }
    return (
        array
    )
}

export default Expenses;
